SELECT	v.VehicleId,
		v.Registration,
		v.FleetNumber,
		i.TrackerNumber,
		c.Name as Customer,
		[dbo].[GetVehicleGroupNames](v.VehicleId, @uid) as [Group],
		SUBSTRING(v.BodyType, CHARINDEX(',', v.BodyType) + 1, LEN(v.BodyType) - CHARINDEX(',', v.BodyType) + 1) AS VehicleType,
		dbo.TZ_GetTime(h.HeartbeatDateTime, DEFAULT, @uid) AS HeartbeatDateTime,
		h.Econospeed,
		h.SDCard,
		h.Firmware,
		null as [Parameters]
FROM dbo.Vehicle v
INNER JOIN dbo.CustomerVehicle cv on v.VehicleId = cv.VehicleId
INNER JOIN dbo.Customer c on cv.CustomerId = c.CustomerId
INNER JOIN dbo.IVH i ON v.IVHId = i.IVHId
LEFT JOIN (SELECT h.VehicleIntId, MAX(h.HeartbeatId) AS HeartbeatId
		   FROM dbo.Heartbeat h
		   GROUP BY VehicleIntId) x ON v.VehicleIntId = x.VehicleIntId
LEFT JOIN dbo.Heartbeat h ON x.HeartbeatId = h.HeartbeatId
WHERE v.VehicleId IN (SELECT VALUE FROM dbo.Split(@vids, ','))
	AND v.archived = 0 and i.Archived = 0 AND cv.Archived = 0
ORDER BY v.Registration

GO
